script: |
  super -f text -I q5229.spq | sort > q5229.out

inputs:
  - name: q5229.spq
    data: |
      SELECT DISTINCT + - col0 * - ( + col2 ) AS col2 FROM tab1 (FORMAT parquet) WHERE ( NOT ( NOT + + col0 + - col2 IS NOT NULL ) );
  - name: tab1

outputs:
  - name: q5229.out
    data: |
      4896
      5015
      6188
